import { Rings } from "react-loader-spinner";

export default Spinner = () => {
  return (
    <div>
      <Rings
        height="80"
        width="80"
        color="#00000"
        radius="6"
        wrapperStyle={{}}
        wrapperClass=""
        visible={true}
        ariaLabel="rings-loading"
      />
    </div>
  );
};
